import React, { useState } from 'react'



const VideoBox = (props) => {
    console.log(props.name);
  return (
   < div onmouseover="hello(this)" className="grid-item"> 
        <video 
            src
            poster={props.poster}
            desc
            className="home-video"
        ></video>
        
        <span style={{color: 'yellow'}}>{props.name}</span>
        <span id="descc"></span>
        <script>
          function hello(x)
          {
            document.getElementById("descc").innerHTML=props.desc
          }
        </script>
    </div>
  )
}

export default VideoBox
